measurements.description:
Four stellate flowers and 13 buds on two up to 66-cm inflorescences;
 flower gold; dorsal sepal lanceolate, hooded, striped burgundy;
 lateral sepals lanceolate, striped burgundy;
 petals narrowly lanceolate, striped and spotted burgundy;
 lip trilobed, heavily spotted burgundy;
 column yellow, spotted burgundy underside, anther cap yellow;
 substance firm; texture matte, lip velvet.
